import React from 'react';

export const Footer = () => {
 return (
  <footer className="text-muted py-5">
   <div className="container">
    <p className="float-right">
     <a href="#">Back to top</a>
    </p>
    <p>
     Album example is &copy; Bootstrap, but please download and customize
     it for yourself!
    </p>
   </div>
  </footer>
 );
};
